import React, { Fragment } from "react";
import ContentBox from "../components/contentBox";

const Plans = () => {
  return (
    <Fragment>
      <div className="w-100 h-100 h-pr-fl-ma centered b-s-b-b p-10px of-auto ">
        <div
          className="w-100 h-a h-pr-fl-ma p-10px"
          Style="border-bottom: 1px solid; border-color: white;"
        >
          <ContentBox
            title={"Planes"}
            subtitle={"Su nueva identidad de marca."}
          />
        </div>
        <div
          className="w-100 h-a h-pr-fl-ma p-10px"
          Style="border: 1px dashed; border-color: white;"
        >
          {/* CREACIÓN DE MARCA ------------------------------------------------ */}
          <div
          className="m-w-100 w-33 h-a h-pr-fl-ma  p-10px"
          Style="border: 1px solid; border-color: white;"
        >
          <ContentBox
        title={"Creación de marca"}
        subtitle={"Su nueva identidad de marca."}
      />

      <ContentBox
        className="w-100 m-b-10px"
        category={"Diseño"}
     
      />
      <div className="w-100 h-a h-pr-fl-ma d-i-f">
       <ContentBox
        className="w-50 m-b-10px d-i-f" Style="border-bottom: 1px dotted; border-color: white; "
        text={"• Logotipo"}

      />
       <ContentBox
        className="w-50 m-b-10px t-a-r " Style="word-wrap: nowrap; border-bottom: 3px solid; border-color: red; "
        note={"3 a 4 semanas"}

      />
      
      </div>
        <ContentBox
        className="w-100 m-b-10px" Style="border-bottom: 1px dotted; border-color: white; "
        text={"• Logotipo"}

      />
        <ContentBox
        className="w-100 m-b-10px" Style="border-bottom: 1px dotted; border-color: white; "
        text={"• Logotipo"}

      />
        <ContentBox
        className="w-100 m-b-10px" Style="border-bottom: 1px dotted; border-color: white; "
        text={"• Logotipo"}

      />
        <ContentBox
        className="w-100 m-b-10px" Style="border-bottom: 1px dotted; border-color: white; "
        text={"• Logotipo"}

      />
        <ContentBox
        className="w-100 m-b-10px" Style="border-bottom: 1px dotted; border-color: white; "
        text={"• Logotipo"}

      />
       
      



      </div>



        {/* X ------------------------------------------------ */}
        <div
          className="m-w-100 w-33 h-a h-pr-fl-ma  p-10px"
          Style="border: 1px solid; border-color: white;"
        >COSO2</div>
          {/* X ------------------------------------------------ */}
        <div
          className="m-w-100 w-33 h-a h-pr-fl-ma  p-10px"
          Style="border: 1px solid; border-color: white;"
        >COS3</div>

        </div>
      </div>
    </Fragment>
  );
};

export default Plans;
